INSERT INTO `ky_tpzs_task` VALUES ('60', '2', '8', 'R:10764280733438859', '', '——每日里严选——\r\n\r\n《易错字精讲：不做错别字大王！》\r\n\r\n你家孩子也这样吗？\r\n形近字、同音字分不清楚？\r\n错一个字，丢一题的分？\r\n《易错字精讲：不做错别字大王！》\r\n让孩子真正理解和掌握汉字的规范书写\r\n告别错字大王\r\n\r\n😀原价39.8\r\n到手价： 29.8\r\n领券购买：https://sourl.cn/qpWn2u', 'https://devhhb.images.huihuiba.net/2-622abe4f50ade.png', '1646968500', '1646968513', '1646968219', '1646968513', '1', '', '');
INSERT INTO `ky_tpzs_task` VALUES ('61', '2', '8', 'R:10764280733438859', '', '——每日里严选——\r\n\r\n✌《“奔跑吧！汉字英雄”百日百字教学》\r\n\r\n字漂亮，成绩更漂亮\r\n坚持100天\r\n培养练字好习惯\r\n让孩子的作业和卷面工整百倍千倍\r\n\r\n😄原价39.8\r\n😍到手价： 29.8\r\n👉领券购买： https://sourl.cn/Kz8Tzx', 'https://devhhb.images.huihuiba.net/2-622abe7928929.png', '1646972100', '1646972109', '1646968490', '1646972109', '1', '', '');
INSERT INTO `ky_tpzs_task` VALUES ('63', '2', '8', 'R:10764280733438859', '', '——每日里严选——\r\n\r\n✌80节《实用练字视频课》\r\n这是一个成人和孩子都能学习的硬笔书法课。\r\n从培养观察力、控笔训练、笔画、独体字、结构字的书写规律等入手做详细讲解和书写示范，让孩子轻松掌握书写方法、举一反三熟练写。\r\n\r\n😄原价39.8\r\n😍到手价： 29.8\r\n👉领券购买： https://sourl.cn/ywbGAW', 'https://devhhb.images.huihuiba.net/2-622ac489ec092.png', '1646975700', '1646975707', '1646970020', '1646975707', '1', '', '');
INSERT INTO `ky_tpzs_task` VALUES ('64', '2', '8', 'R:10764280733438859', '', '——每日里早安分享——\r\n\r\n7、教会孩子回报，这是父母育儿职责中不能漏掉的一课，也是孩子日后被社会接纳的基础。（高山）\r\n\r\n8、教育不是注满一桶水，而且点燃一把火。——叶芝\r\n\r\n9、孩子的核心竞争在父母；', '', '1647045000', '1647045005', '1647010386', '1647045005', '1', '', '');
INSERT INTO `ky_tpzs_task` VALUES ('65', '2', '8', 'R:10764280733438859', '', '——每日里严选——\r\n\r\n《智慧父母修炼课》\r\n爱孩子更要懂孩子\r\n做一个内心温和又富足的爸妈\r\n学点家庭教育，育儿不焦虑\r\n点击链接购买课程\r\n做智慧父母\r\n\r\n原价39.8\r\n到手价： 19.8\r\n领券购买： https://sourl.cn/jbnt52', 'https://devhhb.images.huihuiba.net/2-622b6294e5033.png', '1647048600', '1647048610', '1647010500', '1647048610', '1', '', '');
INSERT INTO `ky_tpzs_task` VALUES ('66', '2', '8', 'R:10764280733438859', '', '——每日里严选——\r\n\r\n《掌握主动权：99%的家长都需要的14堂亲子课》\r\n没有教不会的孩子\r\n只有用不合适的方法教育孩子的家长\r\n孩子的成长，没有捷径，但有方法\r\n14堂亲子成长视频课\r\n教会父母在失控自控\r\n化焦虑为成长的决心\r\n\r\n原价39.8\r\n到手价： 19.8\r\n领券购买：https://sourl.cn/9gqR4f', 'https://devhhb.images.huihuiba.net/2-622b6300a3070.png', '1647052200', '1647052211', '1647010593', '1647052211', '1', '', '');
INSERT INTO `ky_tpzs_task` VALUES ('67', '2', '8', 'R:10764280733438859', '', '——每日里早安分享——\r\n\r\n10、培养孩子将来成为一个什么样的人永远比孩子现在的成绩是怎样的更为重要。\r\n\r\n11、以善心爱人，以善语待人。孩子，让我们共同营造一片爱心世界。', '', '1647131400', '1647131403', '1647010702', '1647131403', '1', '', '');
