INSERT INTO `ky_tpzs_task` VALUES ('69', '2', '8', 'R:10716352945906469,R:10762980789691068,R:10826135218806757,R:10828901130169411,R:10840821540390231,R:10857021070059103,R:10858763320023205', '', '——每日里严选——\r\n\r\n趣悦读整本书阅读精讲（二阶）\r\n是专门为小学2、3年级学生打造\r\n重点学习多种文学体裁\r\n体会作品情感，掌握初级写作技巧\r\n感受古诗魅力\r\n现价168元，限时赠送398元的教材\r\n\r\n原价168\r\n到手价：138\r\n领券购买：http://u6.gg/ksp5b', 'https://devhhb.images.huihuiba.net/2-622b66ed44282.png', '1647138600', '1647138636', '1647011566', '1647138636', '1', '', '');
INSERT INTO `ky_tpzs_task` VALUES ('70', '2', '8', 'R:10716352945906469,R:10762980789691068,R:10826135218806757,R:10828901130169411,R:10840821540390231,R:10857021070059103,R:10858763320023205', '', '——每日里严选——\r\n\r\n这样有趣的作文课你见过吗？\r\n试看链接：http://u6.gg/kspsp\r\n\r\n让写作成为一种冒险\r\n在探索中掌握看图写话的要点\r\n告别死记硬背，照搬照抄的写作方式\r\n开拓孩子思维和想象力\r\n点燃孩子的写作兴趣\r\n《儿童作文启蒙：随文大世界》\r\n下单购买即可赠价值99元教材\r\n\r\n原价168\r\n到手价：138\r\n领券购买：http://u6.gg/kspsc', 'https://devhhb.images.huihuiba.net/2-622b67fd7b733.png', '1647142200', '1647142243', '1647012338', '1647142243', '1', '', '');
INSERT INTO `ky_tpzs_task` VALUES ('71', '2', '8', 'R:10716352945906469,R:10762980789691068,R:10826135218806757,R:10828901130169411,R:10840821540390231,R:10857021070059103,R:10858763320023205', '', '️——每日里早安分享️——\r\n\r\n12、道德教育最简单的要素是“爱”，是儿童对母亲的爱，对人们积极的爱。这种儿童道德教育的基础，应在家庭中奠定。儿童对母亲的爱是从母亲对婴儿的热爱及其满足于身体生长需要的基础上产生的。进一步巩固和发展这一要素，则有待于学校教育。教师对儿童也应当具有父子般的爱，并把学校融化于大家庭之中。——裴斯泰洛齐', '', '1647153000', '1647153024', '1647012627', '1647153024', '1', '', '');
