INSERT INTO `ky_tpzs_task` VALUES ('129', '1', '4', 'R:10764280733438859', '', '——每日里微语早报——\r\n\r\n2022年3月25日 星期五 农历二月廿三\r\n\r\n1、东航坠机事故：主要撞击点已基本确定，最深处约20米，已搜寻到遗物21件、飞机引擎等残骸183份和部分遇难者遗体残骸。\r\n\r\n2、两部门：2022年4月1日至2022年的12月31日小规模增值税全免。\r\n\r\n3、央行：扎实推进数字人民币研发试点，有序扩大试点范围。\r\n\r\n4、全国铁路4月8日实行新运行图，新图车票今日起陆续发售。\r\n\r\n5、吉林省：连续10天每日新增感染人数超1000例，累计已超2万例。\r\n\r\n6、山东莱西：疫情社会传播风险得到有效控制，社会面已动态清零。\r\n\r\n7、四川：及时纠正个别学校防疫层层加码的做法，不搞“一刀切”。\r\n\r\n8、广西生三孩产假增加至178天，新增育儿假、产前检查陪护假，双方户籍均在边境县可生四孩。\r\n\r\n9、北京市监局：SOHO物业15家分公司因加收电费被罚1.15亿余元。\r\n\r\n10、神舟十三号航天员乘组下周进入返回准备阶段。\r\n\r\n11、美国重新豁免352项中国进口商品关税，商务部：希望美方尽快取消全部对华加征关税。\r\n\r\n12、全球十大金融中心最新排名来了：上海紧随香港排名第四。\r\n\r\n13、北约峰会发表联合声明，决定增加对乌援助、军事部署、成员国军费。\r\n\r\n14、英国加码制裁：冻结65个俄罗斯、白俄罗斯个人和实体资产。\r\n\r\n15、普京宣布向不友好国家供应天然气须用卢布结算，欧洲气价涨三成。\r\n\r\n【微语】一旦你热爱生活，生活就会教你治愈一切的魔法。', '', '1648170600', '1648170604', '1648170427', '1648170604', '1', '', '');
