INSERT INTO `ky_tpzs_task` VALUES ('314', '1', '4', 'R:10764280733438859', '', '——每日里微语早报——\r\n\r\n2022年4月8日 星期五 农历三月初八\r\n\r\n1、卫健委：全民健康水平显著提升，人均预期寿命达77.3岁。\r\n\r\n2、上海将允许非涉疫原因被封控的快递小哥等保供人员走出封控区，回到保供岗位。\r\n\r\n3、广州：对行程码带星省外司机闭环管理，每趟发100元补贴。\r\n\r\n4、浙江：组织小微企业、个体户上职业技能培训班，费用全免。\r\n\r\n5、多家银行证实因疫情可申请推迟还房贷，开通征信异议绿色通道。\r\n\r\n6、淘宝可以改账号名了：正灰度测试中，4月下旬将全面开放，一年可修改一次。\r\n\r\n7、319人！北京公布首批共享单车限制骑行名单，主路违停占比过半。\r\n\r\n8、腾讯旗下企鹅电竞宣布退市，6月7日终止运营。\r\n\r\n9、京东宣布刘强东将卸任京东集团CEO一职，由京东集团总裁徐雷接任。\r\n\r\n10、马来西亚航空一波音737客机紧急折返，乘客称飞机一度骤降，马航承认飞行中遇到技术问题。\r\n\r\n11、日本西南部一火山活动频繁，单日喷发最多达17次。\r\n\r\n12、联合国大会通过决议暂停俄罗斯人权理事会成员资格。\r\n\r\n13、俄罗斯：因制裁被迫支付卢布偿还外债，仍面临债务违约风险。\r\n\r\n14、今年年底前，英国将停止从俄进口石油；欧盟对俄罗斯煤炭的全面禁令将推迟到8月中旬生效。\r\n\r\n15、美高官警告印度：与莫斯科\"战略结盟\"后果将\"长期且严重\"，莫迪：印度坚定捍卫自己利益。​\r\n\r\n【微语】治愈自己最好的方式就是忙碌和早睡。生活不简单，尽量简单过。', '', '1649376000', '1649376003', '1649375432', '1649376003', '1', 'basic', '');
