INSERT INTO `ky_tpzs_task` VALUES ('452', '1', '4', 'R:10764280733438859', '', '——每日里微语早报——\r\n\r\n2022年5月6日 星期五 农历四月初六\r\n\r\n1、交通运输部：全国临时关闭的高速公路收费站和关停服务区清零。\r\n\r\n2、应急管理部：5月南方局地或有暴雨洪水，多地地质灾害风险较高。\r\n\r\n3、教育部：9月起劳动课将正式成为中小学独立课程，学生要学煮饭、种菜、修家电等劳动技能。\r\n\r\n4、北京：延续餐饮业暂停堂食服务，暂停户外大排档经营，不得在店外提供桌椅。\r\n\r\n5、广州：已连续6天实现社会面清零，离穗需持48小时内核酸证明。\r\n\r\n6、浙江首推个体户纾困政策：初次创业可贷50万，推行歇业制度。\r\n\r\n7、河南明确：在防控期间，价格违法最高可罚500万元。\r\n\r\n8、长沙自建房倒塌第10名被困者获救，事故已致26人遇难。\r\n\r\n9、吉林白山一车辆加速逆行致6死2伤，初判系交通意外。\r\n\r\n10、一箭八星！我国成功发射吉林一号宽幅01C卫星。\r\n\r\n11、外媒：不明病因肝炎已蔓延20国，大多数病例在欧洲发现。\r\n\r\n12、韩国加入北约网络防御中心，成该机构首个亚洲国家。\r\n\r\n13、日本官员：因资源有限，不会禁止进口俄罗斯石油。\r\n\r\n14、乌克兰官员：可能将在6月底至7月初展开反攻。\r\n\r\n15、芬兰、瑞典定于5月16日前入北约，俄罗斯：这将破坏欧洲大陆的稳定。​\r\n\r\n【微语】得而不喜，失而不忧，内心宁静，则幸福常在。', '', '1651799703', '1651799826', '1651799737', '1651799826', '1', 'basic', '');
